for(var tabBtn=document.querySelectorAll(".js-tab-item"),tabContent=document.querySelectorAll(".js-content-item"),i=0;i<tabBtn.length;i++)tabBtn[i].addEventListener("click",function(){for(var a=this.dataset.tab,b=document.querySelector("#delivery-"+a),c=0;c<tabBtn.length;c++)tabBtn[c].classList.remove("tabs__item--active");for(var d=0;d<tabContent.length;d++)tabContent[d].classList.remove("content__item--active");b.classList.add("content__item--active"),this.classList.add("tabs__item--active")});